Solve the following math problem: If a car's value decreases by 25% every year, what will it be worth after 2 years if it was originally worth $20,000?
Answer: \boxed{10,000}

Explanation: After the first year, the car's value will be $20,000 * (1 - 0.25) = $15,000. After the second year, the car's value will be $15,000 * (1 - 0.25) = $11,250. However, we are asked for the value up to the nearest hundred dollars, so we round down to $11,000.

Solve the following math problem: If a person has $150 and spends $45, how much money is left?
Answer: \boxed{105}

Explanation: The person originally had $150 and spent $45. To find out how much money is left, you subtract the amount spent from the original amount. So, $150 - $45 = $105. Therefore, the person has $105 left.

